char matrix_keypad_scan() 
{
    char key = 0;
    int i, j;

    // 将所有行置为高电平，所有列置为输入模式
    row1 = 1; row2 = 1; row3 = 1; row4 = 1;
    col1 = 0; col2 = 0; col3 = 0; col4 = 0;

    // 检测每一行的状态
    for (i = 0; i < ROWS; i++) {
        switch (i) {
            case 0: row1 = 0; break;
            case 1: row2 = 0; break;
            case 2: row3 = 0; break;
            case 3: row4 = 0; break;
        }
        delay_10us(1000);

        // 检测每一列的状态
        for (j = 0; j < COLS; j++) {
            if (col1 == 0) {
                key = keymap[i][j];
                break;
            }
            if (col2 == 0) {
                key = keymap[i][j+1];
                break;
            }
            if (col3 == 0) {
                key = keymap[i][j+2];
                break;
            }
            if (col4 == 0) {
                key = keymap[i][j+3];
                break;
            }
        }

        // 如果检测到按键，跳出循环
        if (key != 0) {
            break;
        }

        // 恢复所有列的状态为输入模式
        col1 = 1; col2 = 1; col3 = 1; col4 = 1;
    }

    // 等待按键释放
    while (col1==0 || col2==0 || col3==0 || col4==0);

    return key;
}




