public class MoxingControl : MonoBehaviour
{
//声明当前被点击的零件
private GameObject selectedPart;

//记录被选中三个轴的GameObject
public GameObject xAxis;
public GameObject yAxis;
public GameObject zAxis;

//记录被选中三个轴的Local Position
Vector3 xAxisLocalPos;
Vector3 yAxisLocalPos;
Vector3 zAxisLocalPos;

//记录鼠标按下时的位置
Vector3 initialClickPosition;

void Update()
{
if (Input.GetMouseButtonDown(0)) //鼠标左键点击
{
//从鼠标位置发射一条射线
Ray ray = Camera.main.ScreenPointToRay(Input.mousePosition);

RaycastHit hit; //定义射线碰撞的信息

if (Physics.Raycast(ray, out hit)) //如果射线有碰撞到物体
{
if (hit.collider.gameObject == xAxis || hit.collider.gameObject == yAxis || hit.collider.gameObject == zAxis) //如果点击到坐标轴
{
selectedPart = null; //重置被点击的零件

//记录轴的Local Position
xAxisLocalPos = xAxis.transform.localPosition;
yAxisLocalPos = yAxis.transform.localPosition;
zAxisLocalPos = zAxis.transform.localPosition;

//记录鼠标按下时的位置
initialClickPosition = Input.mousePosition;
}
else //如果点击到零件
{
selectedPart = hit.collider.gameObject; //记录下被点击的零件

//将坐标轴设置在被点击零件的上方
xAxis.transform.position = selectedPart.transform.position + new Vector3(0, 0.2f, 0);
yAxis.transform.position = selectedPart.transform.position + new Vector3(0, 0.2f, 0);
zAxis.transform.position = selectedPart.transform.position + new Vector3(0, 0.2f, 0);

//将坐标轴模型显示出来
xAxis.SetActive(true);
yAxis.SetActive(true);
zAxis.SetActive(true);

//记录轴的Local Position
xAxisLocalPos = xAxis.transform.localPosition;
yAxisLocalPos = yAxis.transform.localPosition;
zAxisLocalPos = zAxis.transform.localPosition;

//将零件高亮显示
Outline outline = selectedPart.GetComponent<Outline>();
if (outline != null)
{
outline.enabled = true;
}

//记录鼠标按下时的位置
initialClickPosition = Input.mousePosition;
}
}
}

if (Input.GetMouseButton(0)) //鼠标左键按下并拖拽
{
if (selectedPart != null) //如果有被点击的零件
{
//获取鼠标移动距离
Vector3 distance = Input.mousePosition - initialClickPosition;

//根据拖拽距离计算移动向量
Vector3 movement = Quaternion.Euler(0, -45, 0) * new Vector3(distance.x, 0, distance.y);

//将位移向量拆分在三个轴上
float xDistance = Vector3.Dot(movement, xAxis.transform.TransformDirection(Vector3.right));
float yDistance = Vector3.Dot(movement, yAxis.transform.TransformDirection(Vector3.up));
float zDistance = Vector3.Dot(movement, zAxis.transform.TransformDirection(Vector3.forward));

//根据拖拽距离移动被选中物体及相应的坐标轴
selectedPart.transform.position += new Vector3(xDistance, yDistance, zDistance);
xAxis.transform.localPosition = xAxisLocalPos + new Vector3(xDistance, 0, 0);
yAxis.transform.localPosition = yAxisLocalPos + new Vector3(0, yDistance, 0);
zAxis.transform.localPosition = zAxisLocalPos + new Vector3(0, 0, zDistance);
}
else //如果没有被点击的零件，则移动坐标轴
{
//获取鼠标移动距离
Vector3 distance = Input.mousePosition - initialClickPosition;

//将位移向量拆分在三个轴上
float xDistance = Vector3.Dot(distance, xAxis.transform.TransformDirection(Vector3.right));
float yDistance = Vector3.Dot(distance, yAxis.transform.TransformDirection(Vector3.up));
float zDistance = Vector3.Dot(distance, zAxis.transform.TransformDirection(Vector3.forward));

//根据拖拽距离移动坐标轴及对应的零件
xAxis.transform.localPosition = xAxisLocalPos + new Vector3(xDistance, 0, 0);
yAxis.transform.localPosition = yAxisLocalPos + new Vector3(0, yDistance, 0);
zAxis.transform.localPosition = zAxisLocalPos + new Vector3(0, 0, zDistance);

//如果选中了零件，也将零件移动
if (selectedPart != null)
{
selectedPart.transform.position += new Vector3(xDistance, yDistance, zDistance);
}
}
}

if (Input.GetMouseButtonUp(0)) //鼠标左键松开
{
if (selectedPart != null) //如果有被点击的零件
{
//取消零件的高亮显示
Outline outline = selectedPart.GetComponent<Outline>();
if (outline != null)
{
outline.enabled = false;
}

selectedPart = null; //重置被点击的零件
}

//将坐标轴模型隐藏
xAxis.SetActive(false);
yAxis.SetActive(false);
zAxis.SetActive(false);
}
}

