// 检查参数个数
if (args.length != 1) {
System.out.println(“Usage: java PingServer port”);
return;
}

// 解析参数
int port = Integer.parseInt(args[0]);

// 创建DatagramSocket并绑定到指定端口
DatagramSocket socket = new DatagramSocket(port);
System.out.println("Ping server is running on port " + port);

// 构造接收数据包
byte[] buf = new byte[1024];
DatagramPacket packet = new DatagramPacket(buf, buf.length);

// 循环接收和处理客户请求
while (true) {
try {
// 接收请求
socket.receive(packet);


// 模拟分组传输延迟
int delay = (int) (Math.random() * 1500);
Thread.sleep(delay);

// 处理请求
String message = new String(packet.getData(), 0, packet.getLength());
Date now = new Date();
String response = "Reply: " + message + " " + now.toString();

// 发送响应
byte[] data = response.getBytes();
InetAddress address = packet.getAddress();
int clientPort = packet.getPort();
packet = new DatagramPacket(data, data.length, address, clientPort);
socket.send(packet);
} catch (Exception e) {
e.printStackTrace();
}
}
}
}import java.net.;
import java.util.Date;

public class PingClient {

public static void main(String[] args) throws Exception {
// 检查参数个数
if (args.length != 2) {
System.out.println(“Usage: java PingClient host port”);
return;
}

// 解析参数
String host = args[0];
int port = Integer.parseInt(args[1]);

// 创建DatagramSocket
DatagramSocket socket = new DatagramSocket();

// 循环发送请求并等待响应
int times=0;
int seq = 0;
long start = 0, end = 0;
long minRTT = Long.MAX_VALUE, maxRTT = Long.MIN_VALUE;
long sumRTT = 0;
for (int i = 0; i < 10; i++) {
times++;
// 构造请求消息
Date now = new Date();
String message = "PingUDP " + times + " " + now.getTime() + “\r\n”;
byte[] data = message.getBytes();

// 记录开始时间
start = System.currentTimeMillis();

// 发送请求
InetAddress address = InetAddress.getByName(host);
DatagramPacket packet = new DatagramPacket(data, data.length, address, port);
socket.send(packet);

// 接收响应并计算折返时间(RTT)
packet = new DatagramPacket(new byte[1024], 1024);
socket.receive(packet);
end = System.currentTimeMillis();
long RTT = end - start;
if (RTT > 1000) {
System.out.println(“Request or reply lost”);
continue;
}
sumRTT += RTT;
// 更新最小RTT和最大RTT
minRTT = Math.min(minRTT, RTT);
maxRTT = Math.max(maxRTT, RTT);

// 输出响应内容和RTT
message = new String(packet.getData(), 0, packet.getLength());
System.out.println("Response: " + message.trim());
System.out.println("RTT: " + RTT + “ms”);

seq++;
}

// 输出统计信息
System.out.println("最小 RTT: " + minRTT + “ms”);
System.out.println("最大 RTT: " + maxRTT + “ms”);
System.out.println("平均 RTT: " + sumRTT / seq + “ms”);
}

}

